import React from 'react';
import starIcon from '../images/star.png';

export default function Card () {
    return (
        <div className="card">
            <img src={starIcon} alt='star-icon'/>

            <div className='card-status'>
                <span>5.0</span>
                <span>(6) &#x2022;</span>
                <span>USA</span>
            </div>
            <p>Life lessons with kaya</p>
            <p>From $136 / person</p>
        </div>
    );
}
